script: |
  super -f tsv -I q9260.sql | sort > q9260.out

inputs:
  - name: q9260.sql
    data: |
      SELECT ALL col1 AS col2 FROM tab2 AS cor0 WHERE - col1 NOT BETWEEN - + 15 AND + - ( + - NULLIF ( - + col0, - ( + col1 ) ) ) - + col2 GROUP BY col1 HAVING NULL IS NULL;
  - name: tab2

outputs:
  - name: q9260.out
    data: |
      41
      59
      61
